import React from "react";
import { View, StyleSheet, Text } from "react-native";

const BoxScreen = () => {
  return (
    <View style={styles.viewPoint}>
      <Text style={styles.textOneStyle}>Child 1 </Text>
      <Text style={styles.textTwoStyle}>Child 2 </Text>
      <Text style={styles.textThreeStyle}>Child 3 </Text>
    </View>
  );
};

const styles = StyleSheet.create({
  viewPoint: {
    margin: 15,
    borderWidth: 2,
    padding: 15,
    borderColor: "red",
    height: 200,
    justifyContent: "space-between",
    flexDirection: "row",
  },
  text: {
    backgroundColor: "red",
  },
  textOneStyle: {
    borderWidth: 4,
    borderColor: "black",
    padding: 10,
    flex: 1,
  },
  textTwoStyle: {
    borderWidth: 4,
    borderColor: "black",
    padding: 10,
    flex: 1,
    alignItems: center,
  },
  textThreeStyle: {
    borderWidth: 4,
    borderColor: "black",
    padding: 10,
    flex: 1,
  },
});

export default BoxScreen;
